# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.Forms.Field~Subclass
    - ajax_select
    - Member[fields].Member[AutoCompleteField]
  - - Django.Forms.Field~Subclass
    - ajax_select
    - Member[fields].Member[AutoCompleteSelectField]
  - - Django.Forms.Field~Subclass
    - ajax_select
    - Member[fields].Member[AutoCompleteSelectMultipleField]
  - - Django.db.models.Model~Subclass
    - ajax_select
    - Member[fields].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - ajax_select
    - Member[fields].Member[Model]
  - - django.forms.BaseForm~Subclass
    - ajax_select
    - Member[helpers].Member[ModelForm]
  - - django.http.response.HttpResponse~Subclass
    - ajax_select
    - Member[views].Member[HttpResponse]
